--[[
定义了点击选项后的行为. 也是这个 App 最关键的函数.
在这个例子中, 点击选项后会将玩家传送到指定地点.
--]]
---@param player Player,
---@param itemGossipOption ItemGossipOptionType,
local function PlayerAction(
        player,
        itemGossipOption
)
    -- See https://www.azerothcore.org/pages/eluna/Player/Teleport.html
    player:Teleport(
            itemGossipOption.data.map,
            itemGossipOption.data.x,
            itemGossipOption.data.y,
            itemGossipOption.data.z,
            0
    )
end

-- 定义玩家输入的命令
local command = "#tele"
-- 定义 gossip menu 的 id, 要确保在有多个类似于这个 App 的情况下, 这个 id 是唯一的
local gossip_menu_id = 103001
-- 定义 gossip menu 的 npc_text_id
local npc_text_id = gossip_menu_utils.DEFAULT_NPC_TEXT_ID

-- 创建一个 PlayerChatCommandTreeGossipMenuHandler 的实例
TeleportPlayerChatCommand.TeleportHandler = player_chat_command_utils.PlayerChatCommandTreeGossipMenuHandler.new(
        TeleportPlayerChatCommand.gossipOptionList,
        command,
        gossip_menu_id,
        npc_text_id,
        PlayerAction
)

-- Register Events
TeleportPlayerChatCommand.TeleportHandler:RegisterEvents()
